window.bookSummaryJSON = "<p><b>Quinn Darkova made a vow from the very beginning. And now she's home. For revenge...</b></p> <p>Except N'skara isn't the same as it was ten years ago, and the person she came for is nowhere to be found. After being taken ashore by armed guards of the same Council they came to sway, Quinn knows it's up to her to uncover the truth about what really happened, while seeking the retribution owed to her.</p> <p>Lazarus knew she was hiding something. He knew she had unfinished business in N'skara. But never could he have known this. He hadn't predicted how set in their ways the people were. He hadn't listened to the warnings when Quinn spoke of secrets and lies. He hadn't realized that the woman he couldn't stay away from was forged as much by blood as she was by darkness.</p> <p>Now it was time to learn. In a land of sheep, it pays to be a wolf.</p> <p><b>Contains mature themes.</b></p>"; 
